import Link from 'next/link';

const PageHeader = () => {
  return (
    <div>
      <Header>
        <nav>
          <Link href="/"><a>Page One</a></Link>
          <Link href="/"><a>Page Two</a></Link>
        </nav>
      </Header>
    </div>
  )
}

export default PageHeader;
